import "./HeroImgStyles.css";

import React from "re";
import IntroImg from "../assets/intro-bg.jpg";

const HeroImg = () => {
  return (
    <div className="hero">
        <div className="mask">
            <img className="into-img" src={IntroImg} alt="IntroImg" />
        </div>
      
    </div>
  )
}

export default HeroImg;
